import{_ as e,o as t,c as a,O as i}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 55.1-1100 Definitions.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/55.1-1100.md","filePath":"vacode/55.1-1100.md"}'),n={name:"vacode/55.1-1100.md"},r=i('<h1 id="§-55-1-1100-definitions" tabindex="-1">§ 55.1-1100 Definitions. <a class="header-anchor" href="#§-55-1-1100-definitions" aria-label="Permalink to &quot;§ 55.1-1100 Definitions.&quot;">​</a></h1><p>As used in this chapter, unless the context requires a different meaning:</p><p>&quot;Commercial real estate&quot; means any real estate other than (i) real estate containing one to four residential units or (ii) real estate classified for assessment purposes under the provisions of Article 4 (§ <a href="/vacode/58.1-3230/">58.1-3230</a> et seq.) of Chapter 32 of Title 58.1. Commercial real estate does not include single-family residential units, including condominiums, townhouses, apartments, or homes in a subdivision when leased on a unit-by-unit basis even though these units may be part of a larger building or parcel of real estate containing more than four residential units.</p><p>&quot;Principal broker&quot; means the same as that term is defined in regulations promulgated by the Real Estate Board.</p><p>1992, c. 877, § 55-526; 2009, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?091+ful+CHAP0262" target="_blank" rel="noreferrer">262</a>; 2019, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0712" target="_blank" rel="noreferrer">712</a>.</p>',5),o=[r];function s(l,c,d,u,f,h){return t(),a("div",null,o)}const m=e(n,[["render",s]]);export{_ as __pageData,m as default};
